"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 5\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Light Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Light List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Light Grid Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Shading 1 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Shading 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium List 1 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium List 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 1 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 3 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Dark List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 6\\\\\" ></w:LsdException>\r\n</w:LatentStyles></xml><![endif]--><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">卫生间是人们生活中的一个组成部分，具有强大的功能性，随着现代人对美的追求的提高，卫生间也被赋予了观赏性。从洗手盘、马桶、浴缸、花洒等的设计到</span></span><span><a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2015-03-11/1825.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\">卫生间瓷砖</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">的搭配，都在打造个性化卫生间中十分重要。</span></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">那么，卫生间装修设计时，用马赛克还是瓷砖好？要解答这个问题，有必要先解释一下马赛克和瓷砖的区别。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2014-10-25/1081.html\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\">马赛克</span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">和瓷砖的区别主要在制作、特点、用途上。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">制作马赛克是把砖料经半干后压成型，然后在窑内焙烧成马赛克，添加如氧化钙、氧化铁等的材料作为着色剂，让马赛克能够显示出更多种多样的绚丽色彩。而瓷砖的主要制作原料是粘土和石英砂，将原材料经研磨、混合、压制成型，然后再在表面施以釉浆，最后再经过一道烧结的程序。论制作工艺，瓷砖比马赛克要复杂一些。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">马赛克一般体积比较小，如<font face=\\\\\"Times New Roman\\\\\">20*20mm</font><font face=\\\\\"宋体\\\\\">，</font><font face=\\\\\"Times New Roman\\\\\">25*25mm</font><font face=\\\\\"宋体\\\\\">，</font><font face=\\\\\"Times New Roman\\\\\">30*30mm</font><font face=\\\\\"宋体\\\\\">等，而且颜色斑斓，是家居生活里的一道亮色。瓷砖与马赛克相比，颜色偏纯，不像马赛克一样丰富多变，但胜在简约，给人不同的视觉体验。</font></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">而在用途上，马赛克的用途比瓷砖的用途少，马赛克因为体积小，可是拼成各种装饰图案，比较适用于小面积的装饰，而且因为灯光打在色彩绚丽的马赛克上效果很好，所以马赛克经常用于夜晚周边环境比较暗的场所。瓷砖因为面积较大，通常用于大面积的装修，主要是室内的地面、墙砖等。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">卫生间装修选用马赛克还是瓷砖好，主要从场景角度考虑，卫生间通常比较潮湿，而瓷砖的吸水率比较低，具有防潮透气的功能，兼具防滑性的基础上，降低了墙砖脱落墙面的几率。同时可以用马赛克进行小面积的装饰点缀，增添卫生间装修设计的丰富感。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">如</span></span><span><a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2014-12-17/1544.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\">佛山瓷砖十大品牌</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">哈德逊专门为卫生间装修搭配的花样年华瓷片<font face=\\\\\"Times New Roman\\\\\">+</font><font face=\\\\\"宋体\\\\\">梦幻花海花片</font><font face=\\\\\"Times New Roman\\\\\">+</font><font face=\\\\\"宋体\\\\\">地中海风格马赛克，是卫生间装修设计中的佼佼者，如此搭配的卫生间给人&ldquo;面朝大海，春暖花开&rdquo;的朴素唯美感，在地中海马赛克的点缀下，更是让人心生对大海的向往。</font></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align: center;\\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;<img width=\\\\\"550\\\\\" height=\\\\\"412\\\\\" alt=\\\\\"卫生间装修,卫生间马赛克,卫生间瓷砖.jpg\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-31/25f17e87019429df0a5ba270ad7cc11a.jpg\\\\\" /></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">哈德逊瓷砖秉承为客户打造舒适家居的理念，在产品设计和制作上都与国际接轨，产品由意大利名师设计，产品生产经国外瓷砖检验标准检查，质量远超国内平均水平。哈德逊瓷砖打通了线上线下，率先进军陶瓷电商领域，经过<font face=\\\\\"Times New Roman\\\\\">5</font><font face=\\\\\"宋体\\\\\">年的发展，已经成为陶瓷电商领域的佼佼者。网购瓷砖，当选哈德逊。</font></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">文章来源：哈德逊瓷砖编辑原创</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">转载请注明出处</span></span><span><a href=\\\\\"http://www.hudsonhome.cn/\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">http://www.hudsonhome.cn<font face=\\\\\"宋体\\\\\">&ensp;</font></span></span></a></span></p>\r\n<p>&nbsp;</p>');");
