lse\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 6\\\\\" ></w:LsdException>\r\n</w:LatentStyles></xml><![endif]--></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">那么，在购买马赛克时，如何辨别马赛克质量的好坏呢？哈德逊小编在此教你五大招：</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">看单块马赛克，如果：</span><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\"><br />\r\n</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">（<font face=\\\\\"Times New Roman\\\\\">1</font><font face=\\\\\"宋体\\\\\">）有条纹装饰的玻璃马赛克，条纹所占的面积</font><font face=\\\\\"Times New Roman\\\\\">20%</font><font face=\\\\\"宋体\\\\\">以上且分布均匀的，为上品；</font></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">（<font face=\\\\\"Times New Roman\\\\\">2</font><font face=\\\\\"宋体\\\\\">）背面有锯齿状或阶梯状沟壑，为上品；</font></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align: center;\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;<img width=\\\\\"550\\\\\" height=\\\\\"342\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-31/6580aeae34036c3d37697c95d63c9c75.jpg\\\\\" alt=\\\\\"如何辨别马赛克好坏.jpg\\\\\" /></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align: center;\\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">（<font face=\\\\\"Times New Roman\\\\\">3</font><font face=\\\\\"宋体\\\\\">）用来粘贴马赛克的材料能轻易从马赛克表面去掉，为上品；</font></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">（<font face=\\\\\"Times New Roman\\\\\">4</font><font face=\\\\\"宋体\\\\\">）在自然光线下，据马赛克表面</font><font face=\\\\\"Times New Roman\\\\\">50cm</font><font face=\\\\\"宋体\\\\\">看唔裂纹、黑点、缺边缺觉现象，为上品；</font></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">（<font face=\\\\\"Times New Roman\\\\\">5</font><font face=\\\\\"宋体\\\\\">）随机抽取几件样品，平放在光线充足的地方，</font><font face=\\\\\"Times New Roman\\\\\">1.5m</font><font face=\\\\\"宋体\\\\\">开外观察，色泽均匀，为上品。</font></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">希望<a href=\\\\\"http://www.hudsonhome.cn\\\\\"><span style=\\\\\"color: rgb(0, 0, 255);\\\\\">哈德逊</span></a>小编的五大招式能帮你辨别马赛克质量好坏，让大家在购买马赛克时都是火眼金睛。</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\"><!--[if gte mso 9]><xml><w:WordDocument><w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel><w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery><w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery><w:DocumentKind>DocumentNotSpecified</w:DocumentKind><w:DrawingGridVerticalSpacing>7.8 磅</w:DrawingGridVerticalSpacing><w:PunctuationKerning></w:PunctuationKerning><w:View>Normal</w:View><w:Compatibility><w:DontGrowAutofit /><w:BalanceSingleByteDoubleByteWidth /><w:DoNotExpandShiftReturn /><w:UseFELayout /></w:Compatibility><w:Zoom>0</w:Zoom></w:WordDocument></xml><![endif]--><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">文章来源：哈德逊瓷砖编辑原创</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState=\\\\\"false\\\\\"  DefUnhideWhenUsed=\\\\\"true\\\\\"  DefSemiHidden=\\\\\"true\\\\\"  DefQFormat=\\\\\"false\\\\\"  DefPriority=\\\\\"99\\\\\"  LatentStyleCount=\\\\\"260\\\\\" >\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Normal\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 1\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Pr